//Round numbers to units
int RoundUnits(int value)
{ 
  return (value >= 0) ? (value) : (value - 1);
}

//Round numbers to tens
int RoundTens(int value) 
{ 
    return ((value + 5) / 10) * 10; 
}

//Round numbers to hundreds
int RoundHundreds(int value) 
{ 
    return ((value + 50) / 100) * 100; 
}

//Round numbers to thousands
int RoundThousands(int value) 
{ 
   return ((value + 500) / 1000 ) * 1000; 
}

